import './App.css';
import {BrowserRouter, Route} from 'react-router-dom';
import Welcome from './screens/Welcome/index';
import Profile from './screens/Profile';

const App =()=>
<BrowserRouter>
  <main className='App'>
    <Route path='/' component={Welcome} />
    <Route path='/profile' component={Profile} />
  </main>
</BrowserRouter>;



export default App;
